import React from "react";

const ReadOnly = (data) => {
  return (
    <tr>
      <td>{data.name}</td>
      <td>{data.position}</td>
      <td>{data.office}</td>
      <td>{data.age}</td>
      <td>{data.startdate}</td>
      <td>{data.salary}</td>
    </tr>
  );
};

export default ReadOnly;
